description:
LastEnd Visual RPG Studio gives you the power to create your own original games without any special knowledge or training. All you need is a computer an a imagination, and your on the way to making your own game. VRS allow for almost endless maps that can contain up to 10,000,000 tiles. Open public Beta testing.

